【商品説明】<br>医療現場で実績を誇るメディコムジャパンから、プロフェッショナルのノウハウを活かしたマスクです。ノーズピース部分に専用アルミバーを使用することにより抜群のフィット感が得られます。また、眼鏡が曇りにくいアンチフォグ加工を施した高機能な商品です。女性向けに色を淡いピンクに、サイズも小さめに仕上げております。<br>使用方法用途など：<BR>1．鼻と口を覆うように顔に当て、ノーズピースを鼻のカタチにしっかり曲げ合わせて、耳ひもをかけます。\n　※ゴム紐を溶着している面を外側にしてください。\n2．下の端を引っぱってあごを覆い、顔とマスクの間に『スキマ』が出来ないように、全体を調整します。<br>使用上の注意：<BR>●顔とマスクの間に隙間が出来ると本来の性能が得られません。着用方法に従って、鼻からあごを覆うように正しく装着してください。●本品は一回使い切りタイプです（洗濯は出来ません）。●衛生的にご使用いただくために、少なくとも一日一回取り替えるようにしてください。●本品は産業用の防塵・防毒マスクではありません。有毒なガスや粉塵の発生する場所でのご使用はできません。●火気のそばでは使用しないでください。●本品を使用中にかゆみ、発赤、発疹などの病状が現れた場合は使用を中止し、医師または薬剤師に相談してください。●本品使<br>保管保存方法：<BR>●湿気の無い清潔なところに保管してください。●乳幼児の手が届かないところに保管してください。<br>保管および取扱い上の注意：<BR>●廃棄時は自治体の定める方法に従って処理してください。<br>問い合わせ先：<BR>メディコムジャパン　神戸市中央区江戸町９６番地８階　ＴＥＬ０７８－３２７－２３３３<br>原産国：中華人民共和国<br>ブランド：ドクターガード<BR>商品サイズ：120×80×212<br>JANコード：4894476001649<BR>cs：100<BR>商品カテゴリ： 衛生用品　＞　マスク　＞　マスク　(130700)<BR><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
