【商品説明】<br>アロマの香りでリフレッシュ！深くてほんのり甘いローズの香りが疲れた心を癒します。ノーズフィットと顔の形にそった構造でほほにフィットしスキマを作りません。やわらかストレッチ耳かけで、繰り返しつけ外ししても長時間フィットが続き、耳が痛くありません。<br>シルクタッチフィルタでつけ心地快適。<br>使用方法用途など：<BR>１．着用前にマスクを２～３度たたいてください。２．耳かけ部分の「仮止め」をカットします。３．マスク下部のアルファベットが正しく読める面を表面にしてください。耳かけ部分を引っ張りながら、マスクを耳にかけます。４．「ノーズフィット」を鼻の形に合わせてフィットさせます。プリーツの折り目を縦に伸ばしてマスクを広げます。<br>使用上の注意：<BR>・個人差により、眼鏡が曇る場合がありますので、運転の際などは十分にご注意ください。・本品は使いきり商品です。洗濯による再使用はできません。・耳かけを引っ張りすぎると、ゆるくなることがあります。・本品は有害な粉塵やガス等の発生する場所でのご使用はできません。・万一、かゆみ・カブレ等の症状があらわれた場合は、直ちにご使用をやめ、医師にご相談ください。・万一、においにより気分が悪くなった場合は、ご使用をおやめください。・乳幼児の手の届かない所に保管してください。・高温多湿な場所での保管は避けてください。・火気の<br>問い合わせ先：<BR>〒108-8575東京都港区三田3-5-27 住友不動産三田ツインビル西館 ユニ・チャーム株式会社「お客様相談センター」宛 ベビー用品　０１２０-１９２-８６２ 生理用品　０１２０-４２３-００１生活用品　０１２０-５７３-００１衛生用品（マスク）　０１２０-０４１-０６２<br>ブランド：超快適マスク<BR>商品サイズ：120×220×15<br>JANコード：4903111906635<BR>cs：60<BR>商品カテゴリ： 衛生用品 ＞ マスク ＞ マスク　(130700)<BR><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
